import React from 'react'
import photos from '../data'

const Homepage = () => {
	return (
		<>
		{photos.map((photo) => (
			<>
			<img src={photo.url} />
			<p>{photo.title}</p>
			</>
		))}
		</>

	)
}

export default Homepage
